import { useState } from 'react'

const Task = () => {
    return (
        <>
            {
                tasks.map(
                    (task) => (
                    <h3 key={task.id}>{task.id}. {task.text}</h3>
                    )
                )
            }
        </>
    )
}

export default Task

const tasks = [
    {
        id: 1,
        text: 'Work at CSIT',
        day: 'Feb 5th at 2:30pm',
        reminder: false,
    },
    {
        id: 2,
        text: 'Buy groceries',
        day: 'Feb 5th at 2:30pm',
        reminder: true,
    }
]
